import React from "react";
import "./App.css";
import Footer from "./components/footer/Footer";
import Header from "./components/header/Header";
import OperatorsContainer from "./components/operators/OperatorsContainer";
import { BrowserRouter, Route } from "react-router-dom";
import CheckList from "./components/Check/CheckList";

function App(props) {
  console.log("/checklist/" + props.state[0].id);
  return (
    <BrowserRouter>
      <div className="app__wrapper">
        <Header />
        <Route path="/operators" render={() => <OperatorsContainer />} />
        <Route path="/checklist/:operatorId" render={() => <CheckList />} />

        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
